def rank_programming_languages(languages):
    """"""
    weights = {'job_listings': 0.2, 'popularity': 0.2, 'github_projects': 0.2, 'adoption_rate': 0.2, 'performance_benchmarks': 0.2}
    languages = [language for language in languages if language['release_year'] >= 2010]
    for language in languages:
        language['total_weighted_score'] = language['job_listings'] * weights['job_listings'] + language['popularity'] * weights['popularity'] + language['github_projects'] * weights['github_projects'] + language['adoption_rate'] * weights['adoption_rate'] + language['performance_benchmarks'] * weights['performance_benchmarks']
    languages.sort(key=lambda x: x['total_weighted_score'], reverse=True)
    return languages[:5]
